DROP TABLE IF EXISTS `sys_file_tree`;
CREATE TABLE `sys_file_tree` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `parent_id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `parent_ids` varchar(2000) COLLATE utf8_bin NOT NULL COMMENT '',
  `tree_leaf` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '0:,1:',
  `tree_level` decimal(4,0) NOT NULL COMMENT '(0:)',
  `name` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '',
  `sort` decimal(10,0) NOT NULL COMMENT '',
  `create_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `create_date` datetime NOT NULL COMMENT '',
  `update_by` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '',
  `update_date` datetime NOT NULL COMMENT '',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '01',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='';

